import styles from './dronedisplay.module.scss';

function Dronedisplay()   {

    return (
        <div className={styles['drone']}>
            <div className={styles['row']}>
                <div>
                    <b>DJI Mini SE</b>
                </div>
                <img src="https://picsum.photos/100" />
            </div>
        </div>
    )
}

export default Dronedisplay;
